DROP PROCEDURE IF EXISTS `AssignComplaint`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `AssignComplaint` (IN `p_complaint_id` INT, IN `p_assigned_to` INT, IN `p_admin_id` INT, IN `p_admin_name` VARCHAR(100))   BEGIN
    DECLARE assigned_admin_name VARCHAR(100);
    
