    ) VALUES (
        p_complaint_id, 'assignment', 'received', 'assigned', 
        CONCAT('Complaint assigned to ', assigned_admin_name), p_admin_id, p_admin_name
    );
    
    SELECT 'Complaint assigned successfully' as message;
