DROP PROCEDURE IF EXISTS `CancelBooking`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CancelBooking` (IN `p_booking_id` INT, IN `p_user_id` INT)   BEGIN
    DECLARE unit_id_var INT;
    DECLARE booking_status VARCHAR(20);
    
    -- Get booking details
    SELECT unit_id, status INTO unit_id_var, booking_status
    FROM bookings 
    WHERE id = p_booking_id;
    
    IF booking_status IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Booking not found';
    ELSEIF booking_status = 'cancelled' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Booking is already cancelled';
    ELSEIF booking_status = 'completed' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Cannot cancel completed booking';
    ELSE
        -- Cancel the booking
        UPDATE bookings 
        SET status = 'cancelled', updated_at = CURRENT_TIMESTAMP
        WHERE id = p_booking_id;
        
        -- Make unit available again
        UPDATE units 
        SET availability = 'not taken' 
        WHERE id = unit_id_var;
        
        SELECT 'Booking cancelled successfully' as message;
    END IF;
END$$

DROP PROCEDURE IF EXISTS `CreateBooking`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CreateBooking` (IN `p_unit_id` INT, IN `p_user_id` INT, IN `p_customer_name` VARCHAR(100), IN `p_customer_email` VARCHAR(100), IN `p_customer_phone` VARCHAR(20), IN `p_start_date` DATE, IN `p_end_date` DATE, IN `p_total_amount` DECIMAL(10,2), IN `p_notes` TEXT)   BEGIN
    DECLARE unit_available INT DEFAULT 0;
    DECLARE booking_id INT;
    
    -- Check if unit is available
    SELECT COUNT(*) INTO unit_available 
    FROM units 
    WHERE id = p_unit_id 
    AND status = 'active' 
    AND availability = 'not taken';
    
    IF unit_available = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Unit is not available for booking';
    ELSE
        -- Create the booking
        INSERT INTO bookings (
            unit_id, user_id, customer_name, customer_email, customer_phone,
            start_date, end_date, total_amount, status, payment_status, notes
        ) VALUES (
            p_unit_id, p_user_id, p_customer_name, p_customer_email, p_customer_phone,
            p_start_date, p_end_date, p_total_amount, 'pending', 'pending', p_notes
        );
        
        SET booking_id = LAST_INSERT_ID();
        
        -- Update unit availability
        UPDATE units SET availability = 'taken' WHERE id = p_unit_id;
        
        -- Return the booking ID
        SELECT booking_id as new_booking_id;
    END IF;
END$$

DROP PROCEDURE IF EXISTS `CreateComplaint`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CreateComplaint` (IN `p_user_id` INT, IN `p_customer_name` VARCHAR(100), IN `p_customer_email` VARCHAR(100), IN `p_customer_phone` VARCHAR(20), IN `p_category_id` INT, IN `p_subject` VARCHAR(200), IN `p_description` TEXT, IN `p_priority` VARCHAR(10), IN `p_booking_id` INT, IN `p_payment_id` INT)   BEGIN
    DECLARE complaint_id INT;
    DECLARE complaint_number VARCHAR(20);
    
    -- Generate complaint number
    SET complaint_number = CONCAT('CMP', YEAR(CURDATE()), LPAD(FLOOR(RAND() * 100000), 5, '0'));
    
    -- Insert complaint
    INSERT INTO complaints (
        complaint_number, user_id, customer_name, customer_email, customer_phone,
        category_id, subject, description, priority, booking_id, payment_id
    ) VALUES (
        complaint_number, p_user_id, p_customer_name, p_customer_email, p_customer_phone,
        p_category_id, p_subject, p_description, p_priority, p_booking_id, p_payment_id
    );
    
    SET complaint_id = LAST_INSERT_ID();
    
    -- Add initial update
    INSERT INTO complaint_updates (
        complaint_id, update_type, new_status, message, created_by_name
    ) VALUES (
        complaint_id, 'system_update', 'received', 'Complaint received and logged in system', 'System'
    );
    
    SELECT complaint_id as new_complaint_id, complaint_number as complaint_ref;
END$$

DROP PROCEDURE IF EXISTS `GetAvailableUnits`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAvailableUnits` (IN `warehouse_id` INT)   BEGIN
    SELECT 
        u.id,
        u.name as unit_name,
        w.name as warehouse_name,
        u.price,
        u.created_at
    FROM units u
    JOIN warehouses w ON u.warehouse_id = w.id
    WHERE u.warehouse_id = warehouse_id 
    AND u.status = 'active' 
    AND u.availability = 'not taken'
    ORDER BY u.name;
END$$

DROP PROCEDURE IF EXISTS `GetMonthlyRevenue`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetMonthlyRevenue` (IN `p_year` INT, IN `p_month` INT)   BEGIN
    SELECT 
        w.name as warehouse_name,
        COUNT(b.id) as total_bookings,
        SUM(b.total_amount) as total_revenue,
        SUM(CASE WHEN b.payment_status = 'paid' THEN b.total_amount ELSE 0 END) as collected_revenue,
        SUM(CASE WHEN b.payment_status = 'pending' THEN b.total_amount ELSE 0 END) as pending_revenue,
        SUM(CASE WHEN b.payment_status = 'partial' THEN b.total_amount ELSE 0 END) as partial_revenue
    FROM bookings b
    JOIN units u ON b.unit_id = u.id
    JOIN warehouses w ON u.warehouse_id = w.id
    WHERE YEAR(b.start_date) = p_year 
    AND MONTH(b.start_date) = p_month
    AND b.status != 'cancelled'
    GROUP BY w.id, w.name
    ORDER BY total_revenue DESC;
END$$

DROP PROCEDURE IF EXISTS `GetWarehouseUtilization`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetWarehouseUtilization` (IN `warehouse_id` INT)   BEGIN
    SELECT 
        w.name as warehouse_name,
        w.capacity,
        COUNT(u.id) as total_units,
        COUNT(CASE WHEN u.availability = 'taken' THEN 1 END) as occupied_units,
        COUNT(CASE WHEN u.availability = 'not taken' AND u.status = 'active' THEN 1 END) as available_units,
        COUNT(CASE WHEN u.availability = 'under maintenance' THEN 1 END) as maintenance_units,
        COUNT(CASE WHEN u.status = 'inactive' THEN 1 END) as inactive_units,
        ROUND((COUNT(CASE WHEN u.availability = 'taken' THEN 1 END) / w.capacity) * 100, 2) as occupancy_rate
    FROM warehouses w
    LEFT JOIN units u ON w.id = u.warehouse_id
    WHERE w.id = warehouse_id
    GROUP BY w.id, w.name, w.capacity;
END$$

DROP PROCEDURE IF EXISTS `UpdateComplaintStatus`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateComplaintStatus` (IN `p_complaint_id` INT, IN `p_new_status` VARCHAR(20), IN `p_message` TEXT, IN `p_admin_id` INT, IN `p_admin_name` VARCHAR(100))   BEGIN
    DECLARE old_status VARCHAR(20);
    
    -- Get current status
    SELECT status INTO old_status FROM complaints WHERE id = p_complaint_id;
    
    -- Update complaint status
    UPDATE complaints 
    SET status = p_new_status, 
        updated_at = CURRENT_TIMESTAMP,
        resolved_at = CASE WHEN p_new_status = 'resolved' THEN CURRENT_TIMESTAMP ELSE resolved_at END,
        closed_at = CASE WHEN p_new_status = 'closed' THEN CURRENT_TIMESTAMP ELSE closed_at END
    WHERE id = p_complaint_id;
    
    -- Add update record
    INSERT INTO complaint_updates (
        complaint_id, update_type, old_status, new_status, message, created_by, created_by_name
    ) VALUES (
        p_complaint_id, 'status_change', old_status, p_new_status, p_message, p_admin_id, p_admin_name
    );
    
    SELECT 'Status updated successfully' as message;
END$$

