DROP FUNCTION IF EXISTS `GetComplaintStats`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `GetComplaintStats` (`stat_type` VARCHAR(20)) RETURNS INT DETERMINISTIC READS SQL DATA BEGIN
    DECLARE result INT DEFAULT 0;
    
    CASE stat_type
        WHEN 'total' THEN
            SELECT COUNT(*) INTO result FROM complaints;
        WHEN 'pending' THEN
            SELECT COUNT(*) INTO result FROM complaints WHERE status IN ('received', 'assigned', 'in_progress');
        WHEN 'resolved' THEN
            SELECT COUNT(*) INTO result FROM complaints WHERE status = 'resolved';
        WHEN 'closed' THEN
            SELECT COUNT(*) INTO result FROM complaints WHERE status = 'closed';
        WHEN 'high_priority' THEN
            SELECT COUNT(*) INTO result FROM complaints WHERE priority IN ('high', 'urgent');
        ELSE
            SET result = 0;
    END CASE;
    
    RETURN result;
END$$

DROP FUNCTION IF EXISTS `GetWarehouseOccupancyRate`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `GetWarehouseOccupancyRate` (`warehouse_id` INT) RETURNS DECIMAL(5,2) DETERMINISTIC READS SQL DATA BEGIN
    DECLARE total_capacity INT;
    DECLARE occupied_units INT;
    DECLARE occupancy_rate DECIMAL(5,2);
    
    SELECT capacity INTO total_capacity
    FROM warehouses
    WHERE id = warehouse_id;
    
    SELECT COUNT(*) INTO occupied_units
    FROM units
    WHERE warehouse_id = warehouse_id 
    AND availability = 'taken';
    
    IF total_capacity > 0 THEN
        SET occupancy_rate = (occupied_units / total_capacity) * 100;
    ELSE
        SET occupancy_rate = 0;
    END IF;
    
    RETURN occupancy_rate;
END$$

